import { Show, SimpleShowLayout, TextField, EmailField, UrlField,DateField } from 'react-admin';


export const UserShow = props =>(

    <Show {...props} title="sho">

        <SimpleShowLayout>
            <TextField source="id" />
            <TextField source="name" />
            <TextField source="username" />
            <DateField label="Publication date" source="created_at" />
        </SimpleShowLayout>

    </Show>

);
